import React, { Component, lazy, Suspense } from "react";
import { BrowserRouter as Router, Switch, Route} from "react-router-dom"
import Operators from "./components/Operator"

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      activeItem: {
        operator: ""
      },
      operator: [],
      viewbyfaction: false,
      viewbyrelease: false,
      viewall: false,
      faction: 50,
      release: 50
    };
  }
  render() {
    return (
      <Router>
        <Route path="/" exact render={(props) => (<Operators {...props}/>)} />
        <Route path={"operators"} componet={Operators} />
      </Router>
    )
  }
}

export default App;
